import { Component } from 'react';
import './cardList.styles.css'
import Card from '../Card/Card.jsx'

const CardList = ({monsters}) => (
	<div className='card-list'>
		{monsters.map(monster => {
			// const { name, email, id } = monster
			return (
			<Card input={monster} />
			)
		})}
	</div>
)

export default CardList;
